import React, { Component } from "react";
class Count extends Component {
  state = {
    count: 2,
    Tags: [],
  };

  renderTag() {
    return this.state.Tags.map((tag) => <li key={tag}>{tag}</li>);
  }

  render() {
    return (
      <React.Fragment>
        <ul>
          {this.state.Tags === 0 && "create new tag"}
          {this.renderTag()}
        </ul>
        {/* <button className="btn btn-warning">incriment</button> */}
      </React.Fragment>
    );
  }
}

export default Count;
